Information
------------------------------
Cardinal brewery.
On 22 June 2011, after a long decline, the Brasserie du Cardinal bottles its last beer in Fribourg, Switzerland. The final closure causes a real shockwave. This documentary traces the history of the brand from Fribourg: a bitter turn of events and a symbol of the excesses of capitalism.

